            "Christmas Island"->"data:image/png;base64,"
            "Western Sahara"->"data:image/png;base64,"
            "Falkland Islands"->"data:image/png;base64,"
            "South Korea"->"https://www.countries-ofthe-world.com/flags-normal/flag-of-Korea-South.png"
            "North Korea"->"https://www.countries-ofthe-world.com/flags-normal/flag-of-Korea-North.png"
            "Antigua and Barbuda"->"https://www.countries-ofthe-world.com/flags-normal/flag-of-Antigua.png"
            "Antarctica"->"data:image/png;base64,"
            "Anguilla"->"data:image/png;base64,"
