            "Saint-Barthélemy"->"data:image/png;base64,"
            "Bermuda"->"data:image/png;base64,"
            "Bonaire"->"data:image/png;base64,"
            "Bouvet Island"->"data:image/png;base64,"
            "French Southern Territories"->"data:image/png;base64,"
            "Wallis and Futuna"->"data:image/png;base64,"
            "U.S. Virgin Islands"->"data:image/png;base64,"
